import React, { useState, useEffect } from "react";
import { rutaAPI } from "../../config/Config";

import Prospecto from "./presentation/Prospecto";

export default function ProspectoContainer() {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);
  const [prospecto, setProspecto] = useState("");

  useEffect(() => {
    const fetchProspectos = async () => {
      try {
        let res = await fetch(`${rutaAPI}/mostrar-prospecto`);
        let data = await res.json();

        if (data.status === 200) {
          setData(data.data);
        } else {
          setError(data);
        }
      } catch (error) {
        setError(error);
      }
    };
    fetchProspectos();
  }, []);

  const handleProspecto = (e) => {
    const prospectoID = e.target.getAttribute("data");
    console.log(prospectoID);
  };

  return <Prospecto data={data} onClick={handleProspecto} />;
}
